// import Nav from './Nav';
// import Photo from './Photo';



const Nav = () => {

  return(
      <nav className="main-nav">
          <ul>
              <li><a href='3'>Cats</a></li>
              <li><a href='#'>Dogs</a></li>
              <li><a href='#'>Computers</a></li>
          </ul>
      </nav>
  );
}

const PhotoContainer = (props) => {

  return (
      <div className="photo-container">
          <h2>Results</h2>
          <Photo images={props.images}/>
      </div>
  );
}

const Photo = (props) => {
  return (
    <ul>
    {props.images.map(image =>
      <li><img src={image.src}></img></li>
    )}
    </ul>
  );
}


const App = (props) => {

  return (
    <div className="container">
      <Nav />
      <PhotoContainer image={props.images}/>

    </div>



  );
}

export default App;
